class Solution1 {
    public int lengthOfLongestSubstring(String s) {
        // 记录输出的长度
        int maxSubLength = 0;
        // 对输入的s进行处理后输出子串的长度
        // 方法一：双重for循环
        int length = s.length();
        for (int i = 0;i<length;i++){
            for (int j = i+1; j<=length;j++){ // 这里取等于是因为sub是左闭右开的
                // 双重for循环模拟的是从第一个字符开始截取，取遍所有的子串的位置
                // System.out.println(s.substring(i, j)); // 左闭右开
                String substring = s.substring(i, j); // 取到的子串再做一层是否包含重复的判断即可
                boolean unit = unit(substring);
                if (unit){
                    maxSubLength = Math.max(maxSubLength,j-i);
                }
            }
        }
        return maxSubLength;
    }

    boolean unit(String s){
        HashSet<Character> hashSet = new HashSet<>();
        // 判断字符串中是否有重复的元素
        for (int i = 0; i < s.length(); i++) {
            char c = s.charAt(i);
            if (hashSet.contains(c)){
                return false;
            }
            hashSet.add(c);
        }
        return true;
    }
}
